import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';


const { useContext } = React;

const Navbar = () => {

  let imgUrl =
    "https://fontmeme.com/permalink/221006/378fb6eb018d5b35d601ea5965a93928.png"
    let imgUrl2 ='https://img.icons8.com/officel/80/000000/pokedex.png'


  return (
    <nav>
      <div />
      <div>
        
        <img src={imgUrl} alt="pokedex-logo" className="navbar-image" />
      </div>
        <div>
       <a href="youtube.com"> <img src={imgUrl2}  alt="wikidex-logo" className="user-image"/></a>
        </div>

    </nav>
  );
};


export default Navbar;
